;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"82\" height=\"122\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6d7b7d81 \"BufferedImage@6d7b7d81: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4c7d1061 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 82 height = 122 #numDataElements 3 dataOff[0] = 2\"]"}
