;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"738\" height=\"122\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x249eb644 \"BufferedImage@249eb644: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4c7d1061 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 738 height = 122 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(defn rotate-by! 
  ([img angle] (rotate-by! img angle 1))
  ([img angle zoom]
   (let 
     [M2 (get-rotation-matrix-2-d (new-point (/ (.width img) 2) (/ (.height img) 2)) angle zoom)]
    (warp-affine! img M2 (.size img)))))
